import classes from './MealsSummary.module.css';

const MealsSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>Per te gjithe te apasionuarit pas embelsirave!</h2>
      <p>
      Zgjidhni vaktin tuaj të preferuar nga përzgjedhja jonë e gjerë e vakteve të disponueshme dhe 
      shijoni një drekë ose darkë të shijshme në shtëpi, pune apo kudo ku ndodheni.
      </p>
      <p>
      Të gjitha ushqimet tona gatuhen me përbërës të cilësisë së lartë, në kohën e duhur
       dhe sigurisht nga kuzhinierë me përvojë!
      </p>
    </section>
  );
};

export default MealsSummary;
